  fullName: SuperOffice.Threading.AsyncQueueProcessor<TQueue, TItem>
  type: Class
  assemblies:
  - SoCore
  namespace: SuperOffice.Threading
  summary: Base class for hosted service processing items from an async queue
  remarks: >-
    The <xref href="SuperOffice.Threading.AsyncQueueProcessor%602.ExecuteAsync(System.Threading.CancellationToken)" data-throw-if-not-resolved="false"></xref> method is called by the background

    service framework, once. It, in turn, delegates to the _queue.ProcessItemsAsync method,

    which loops until the cancellation token is triggered; if the queue is empty it waits for items

    to arrive.

    <br />

    The <xref href="SuperOffice.Threading.AsyncQueueProcessor%602.ProcessItemAsync(SuperOffice.Threading.IAsyncQueueProcessItemContext%7b%601%7d%2cSystem.Threading.CancellationToken)" data-throw-if-not-resolved="false"></xref> abstract

    method is called for each item in the queue, and must be implemented by derived classes

    to perform whatever processing the actual items should receive.
  example: []
  syntax:
    content: 'public abstract class AsyncQueueProcessor<TQueue, TItem> : BackgroundService, IDisposable, IHostedService where TQueue : IAsyncQueueBase<TItem>'
    typeParameters:
    - id: TQueue
    - id: TItem
      description: Item in the queue
