  namespace: SuperOffice.Threading
  summary: Wrapper for <xref href="SuperOffice.Threading.AsyncQueueProcessor%602.ProcessItemAsync(SuperOffice.Threading.IAsyncQueueProcessItemContext%7b%601%7d%2cSystem.Threading.CancellationToken)" data-throw-if-not-resolved="false"></xref> to catch exceptions and log them.
  remarks: >-
    An unhandled exception in <xref href="SuperOffice.Threading.AsyncQueueProcessor%602.ProcessItemAsync(SuperOffice.Threading.IAsyncQueueProcessItemContext%7b%601%7d%2cSystem.Threading.CancellationToken)" data-throw-if-not-resolved="false"></xref> will exit from the wait-for-cancellation

    loop within the <xref href="SuperOffice.Threading.IAsyncQueueBase%601.ProcessItemsAsync(SuperOffice.Threading.AsyncQueueProcessItemAsync%7b%600%7d%2cSystem.Threading.CancellationToken)" data-throw-if-not-resolved="false"></xref> method, and this will permanently terminate the background service.

    As a result, items will no longer be processed and there is no way to restart it... so we try

    to guard against that.
